import React from 'react';
import Navbar from './components/navBar';
import { css } from '@emotion/react';

function App() {
    const appStyles = {
      backgroundColor: 'white',
      height: '100vh',
      overscrollBehavior: 'none',
      /* Additional styles to extend background into notch area */
      paddingTop: '20px', /* Adjust this padding to match the height of the notch area */
      paddingBottom: '20px', /* Adjust this padding to match the height of the bottom safe area */
      position: 'relative',
      /* Add media queries for different orientations */
      '@media (orientation: landscape)': {
        paddingTop: '10px', /* Adjust this padding for landscape mode */
        paddingBottom: '10px', /* Adjust this padding for landscape mode */
      },
    };
  return (
    <div css={appStyles}>
      <Navbar />

    </div>
  );
}

export default App;
